import React, { useState } from 'react';

export default function Card ({ listofTodos }) {
    return (
        <>
            {listofTodos.map(todo => {
                return (
                    <ul>
                        <li>{todo.content}</li>
                    </ul>
                )
            })}
        </>
    );
}
